import React from "react";
import QnAQuestion from "./QnAQuestion";
import line2 from "../images/line2.png";

function QnAQuestionsAnalysis() {
  return (
    <div>
      <div
        style={{
          marginTop: "4vh",
          height: "15vh",
          width: "100%",
          display: "flex",
        }}
      >
        <div>
          <p
            style={{
              color: "#5076FF",
              fontSize: "2.3em",
              fontWeight: "600",
              paddingTop: "4.5vh",
              paddingLeft: "5.2vw",
              paddingBottom: "1vh",
            }}
          >
            Quiz 2 Question Analysis
          </p>
        </div>
        <div
          style={{
            color: "#FF5D01",
            fontSize: "1.1em",
            fontWeight: "600",
            paddingTop: "5vh",
            paddingLeft: "27vw",
            paddingRight: "2vw",
            paddingBottom: "1vh",
          }}
        >
          <p>Created on : 04 Sep, 2023</p>
          <p>Impressions : 667</p>
        </div>
      </div>
      <div></div>
      <div
        style={{
          width: "70vw",
          marginLeft: "5vw",
          marginRight: "5vw",
        }}
      >
        <QnAQuestion />
        <img style={{ width: "70vw" }} src={line2} alt="line2" />
        <QnAQuestion />
        <img style={{ width: "70vw" }} src={line2} alt="line2" />
        <QnAQuestion />
        <QnAQuestion />
      </div>
    </div>
  );
}

export default QnAQuestionsAnalysis;
